import React, { useEffect, useState } from "react";
import Navbar from "./components/Navbar";
import "./styles/index.css";
import henryImage from "./assets/henry.png";
import sswmsimage from "./assets/sswms.png";

function App() {
  const [typedText, setTypedText] = useState("");
  const [currentIndex, setCurrentIndex] = useState(0);
  const [activeFilter, setActiveFilter] = useState("All");
  const [selectedProject, setSelectedProject] = useState(null);
  const [selectedExperience, setSelectedExperience] = useState(null);
  const [visible, setVisible] = useState(false);

  // Roles para sa typing animation
  const roles = [
    "Frontend Developer",
    "Full Stack Developer",
    "Freelancer",
    "Problem Solver",
  ];

  // ✅ Typing effect
  useEffect(() => {
    const currentRole = roles[currentIndex];
    let charIndex = 0;

    const typeInterval = setInterval(() => {
      if (charIndex <= currentRole.length) {
        setTypedText(currentRole.slice(0, charIndex));
        charIndex++;
      } else {
        clearInterval(typeInterval);
        setTimeout(() => {
          setCurrentIndex((prev) => (prev + 1) % roles.length);
          setTypedText("");
        }, 2000);
      }
    }, 80);

    return () => clearInterval(typeInterval);
  }, [currentIndex]);

  // ✅ Scroll animations (AOS + IntersectionObserver)
  useEffect(() => {
    if (window.AOS) {
      window.AOS.init({
        duration: 800,
        easing: "ease-in-out",
        once: true,
        offset: 100,
      });
    }

    const observerOptions = { threshold: 0.1 };
    const observer = new IntersectionObserver((entries) => {
      entries.forEach((entry) => {
        const el = entry.target;
        if (entry.isIntersecting) {
          el.classList.add("fade-in");
          el.classList.remove("fade-out");
        } else {
          el.classList.remove("fade-in");
          el.classList.add("fade-out");
        }
      });
    }, observerOptions);

    const fadeElements = document.querySelectorAll(".fade-scroll");
    fadeElements.forEach((el) => observer.observe(el));

    return () => observer.disconnect();
  }, []);

  // ✅ Trigger circle + intro animation
  useEffect(() => {
    setTimeout(() => setVisible(true), 500);
  }, []);

  return (
    <>
      <Navbar />

      {/* HERO */}
      <section className="hero text-white" id="home">
        <div className="container">
          <div className="row align-items-center">
            <div
              className="col-lg-6"
              data-aos="fade-right"
              data-aos-duration="1000"
            >
              <img
                src={henryImage}
                alt="Profile"
                className="rounded-circle mb-4 border border-5 border-warning animate__animated animate__zoomIn animate__delay-1s"
                style={{ width: "200px", height: "300px", objectFit: "cover" }}
              />
              <h1 className="display-4 fw-bold mb-3">
                Hi, I'm <span className="text-warning">Henryco Buena</span>
              </h1>
              <h2 className="h3 mb-4">
                I'm a <span className="text-warning">{typedText}</span>
                <span className="typing-cursor">|</span>
              </h2>
              <p className="lead mb-4">
                Passionate about creating digital experiences that make a
                difference. I build modern, responsive, and user-friendly
                applications.
              </p>
              <div className="d-flex gap-3 flex-wrap">
                <a
                  href="#projects"
                  className="btn btn-warning btn-lg px-4 py-2 rounded-pill animate__animated animate__pulse animate__infinite animate__slow"
                >
                  View My Work
                </a>
                <a
                  href="#contact"
                  className="btn btn-outline-light btn-lg px-4 py-2 rounded-pill"
                >
                  Get In Touch
                </a>
              </div>
            </div>

            {/* Right Side Image */}
            <div
              className="col-lg-6 text-center"
              data-aos="fade-left"
              data-aos-duration="1000"
              data-aos-delay="200"
            >
              <div className="position-relative">
                <img
                  src="https://images.unsplash.com/photo-1555066931-4365d14bab8c?w=500&h=400&fit=crop"
                  alt="Coding"
                  className="img-fluid rounded-3 shadow-lg animate__animated animate__fadeInUp animate__delay-2s"
                  style={{ maxWidth: "500px" }}
                />
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* ABOUT SECTION */}
      <section className="about" id="aboutSection">
        <div className="container--main">
          <div className="container--inner">
            <div className="about__animations">
              {/* Intro Text */}
              <div className="about__intro">
                <div className="greeting--container">
                  <h1 className="greeting">
                    <span className={visible ? "show" : ""}>Hi, I'm</span>{" "}
                    <span className={`name__1st ${visible ? "show" : ""}`}>
                      Antonio
                    </span>{" "}
                    <span className={`name__2nd ${visible ? "show" : ""}`}>
                      Carlo Autor
                    </span>
                  </h1>
                </div>

                {/* Circle Animation */}
                <div className="circle__container">
                  <div className={`circle ${visible ? "show" : ""}`}></div>
                </div>
              </div>

              {/* Main Content */}
              <div className="about__main">
                <div className="about__img--container">
                  <img
                    className={`about__img ${visible ? "show" : ""}`}
                    src="group-photo.4f83f472.jpeg"
                    alt="group photo of us"
                  />
                </div>

                <div
                  className={`about__text--container ${visible ? "show" : ""}`}
                >
                  <p className="work-experience">
                    I am a 28-year-old web developer with 2 years of experience
                    in front-end development and 1 year as a full-stack
                    developer...
                  </p>

                  <div className="about-me">
                    <h2>Key Achievements</h2>
                    <ul>
                      <li>
                        <strong>RESTful API Design:</strong> Designed and
                        implemented a{" "}
                        <span className="highlight">RESTful API</span>.
                      </li>
                      <li>
                        <strong>Code Reviews & Mentorship:</strong>{" "}
                        <span className="highlight">
                          Conducted code reviews
                        </span>
                        .
                      </li>
                      <li>
                        <strong>Full Stack Expertise:</strong> Using{" "}
                        <span className="highlight">React.js</span>,{" "}
                        <span className="highlight">Node.js</span>, and{" "}
                        <span className="highlight">PostgreSQL</span>.
                      </li>
                    </ul>

                    <h2>Skills & Specializations</h2>
                    <p>
                      I specialize in creating responsive websites optimized for
                      all devices using a{" "}
                      <span className="highlight">mobile-first workflow</span>.
                    </p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Bootstrap Icons + JS */}
      <link
        href="https://cdnjs.cloudflare.com/ajax/libs/bootstrap-icons/1.10.0/font/bootstrap-icons.min.css"
        rel="stylesheet"
      />
      <script src="https://cdnjs.cloudflare.com/ajax/libs/bootstrap/5.3.0/js/bootstrap.bundle.min.js"></script>
      <script src="https://cdnjs.cloudflare.com/ajax/libs/aos/2.3.4/aos.js"></script>
    </>
  );
}

export default App;
